css:
@-moz-document domain("youtube.com") {
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    background-color: rgba(255,0,0,0.5);
    height: 118.5px;
    margin: -114.5px;

}
#progress.ytd-thumbnail-overlay-resume-playback-renderer::before {
    background-color: rgba(0,0,0,0.6);
	text-shadow: 2px 2px #000000, -2px -2px #000000, -2px 2px #000000, 2px -2px #000000;
    padding-top: 28px;
    content: "Watched";
    font-size: 50px;
	text-align: center;
    position: absolute;
    left: 0;
    width: 100%;
    height: 188.5px;
}
ytd-thumbnail-overlay-resume-playback-renderer {
    background-color: rgba(0,0,0,0);
}
}

@-moz-document url-prefix("https://www.youtube.com/watch") {
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    height: 94px;
    margin: -90px;
}
#progress.ytd-thumbnail-overlay-resume-playback-renderer::before {
    padding-top: 22px;
    font-size: 40px;
}

}

@-moz-document url("https://www.youtube.com/feed/history"), url("https://www.youtube.com/feed/explore") {
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    height: 138px;
    margin: -134px;

}
#progress.ytd-thumbnail-overlay-resume-playback-renderer::before {
    padding-top: 40px;
    font-size: 50px;
}
}

@-moz-document url("https://www.youtube.com/") {
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    height: 203px;
    margin: -199px;
}
#progress.ytd-thumbnail-overlay-resume-playback-renderer::before {
    padding-top: 70px;
    font-size: 50px;
}
}

@-moz-document url-prefix("https://www.youtube.com/results") {
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    height: 202px;
    margin: -198px;
}
#progress.ytd-thumbnail-overlay-resume-playback-renderer::before {
    padding-top: 70px;
    font-size: 50px;
}
}
